Sinopse:
Quando achávamos que o fim da Guerra Fria marcava o "fim da história" e a humanidade enfim viveria em paz, o atentado terrorista de 11/9 - o maior de todos os tempos - mergulhava o mundo em perplexidade. De repente, tomamos conhecimento de entidades e personagens até então desconhecidos: a Al-Qaeda, Osama bin Laden, os campos de treinamento de terroristas no Afeganistão. Mas o que é a Al-Qaeda? Como surgiu? Aonde pretende chegar? Qual sua ideologia? Qual o papel dos serviços de inteligência americanos no caso? São estas perguntas que Lawrence Wright, através de um monumental trabalho de jornalismo investigativo (cinco anos de pesquisas e centenas de entrevistas no Oriente Médio, África, Europa e Estados Unidos), procura esclarecer neste livro exemplar.

- 10 semanas na lista de best-sellers do New York Times; 
- Número um de vendas na Amazon Books; 
