"Saiu um livraço nos Estados Unidos. É The Looming Tower [O vulto das torres], do jornalista Lawrence Wright. Tem três qualidades. Conta a construção do pensamento radical islâmico desde os anos 50, a vida de Osama bin Laden e mostra a incompetência corporativista dos serviços de inteligência americana." - Elio Gaspari, Folha de S. Paulo [10/09/06]

