Se você tem filha, precisa ler este livro.

Educar meninas não é tarefa fácil: são muitas emoções, sentimentos, reações inesperadas e a sensação de que o tempo passa rápido demais. Como então cuidar da educação de sua filha com tranquilidade e afeto, para formar uma mulher consciente, feliz e realizada?

De forma leve, com honestidade e muita experiência, Steve Biddulph, o mundialmente renomado autor de Criando meninos, explica os pontos fundamentais da educação de meninas.

Neste livro, você vai aprender como ajudar sua filha a:
• sentir-se amada e confiante;
• encarar os percalços da puberdade e da adolescência;
• escolher amigos e parceiros que elevem a autoestima;
• sentir-se segura em relação à sexualidade;
• buscar igualdade de oportunidades.

Em um texto apaixonante, claro e repleto de orientações práticas, você ficará por dentro do que é necessário para criar a sua menina com consciência e amor.

As 10 coisas mais importantes para o futuro de sua filha – uma obra indispensável para todos os pais e mães de meninas.

No livro o autor narra a trajetória do filho de imigrantes portugueses analfabetos, nascido em Campinas em 1862. Júlio Mesquita aprendeu a ler por acaso, meteu-se na luta abolicionista na adolescência, estudou direito e, com 26 anos, em 1888, empregou-se em um jornal com 904 assinantes. Fez a empresa dar lucro e acabou comprando O Estado de S. Paulo. Em 1927, ano de sua morte, o jornal tinha 48,6 mil assinantes. Um crescimento de 10,5% ao longo de 40 anos. Júlio Mesquita dividiu as carreiras de jornalista e político. Foi vereador, deputado, líder de bancada e dirigente partidário. Esteve metido em todas as grandes tramas políticas do tempo, ganhando e perdendo batalhas pela democracia. A narrativa empolgante dá conta das múltiplas dimensões de uma figura excepcional  e do jornal que ajudou a transformar o Brasil em um país moderno.

